import{createInstance}from"../../keyword/create-instance.min.js";import{Buildable}from"../../interface/buildable.min.js";import{OperatingSystemHelpModel}from"../../model/help/operating-system-help-model.min.js";import{ThreadingUtility}from"../../shared/utility/threading-utility.min.js";import{PageColorAdjuster}from"../../shared/page-color-adjuster.min.js";import ScriptSeriesLoader from"../../shared/script-series-loader.min.js";import StylesheetSeriesLoader from"../../shared/stylesheet-series-loader.min.js";class OsHelpController extends Buildable{constructor(){super(),this.model=new OperatingSystemHelpModel,this.stylesheetLoader=StylesheetSeriesLoader,this.stylesheetLoader.add("css/work-experience.min.css"),this.stylesheetLoader.load(),this.scriptLoader=ScriptSeriesLoader,this.scriptLoader.add("https://ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js","jQuery"),this.scriptLoader.load()}static build=async()=>{const e=new OsHelpController;for(;e.scriptLoader.running;)await ThreadingUtility.sleep(2e3);return e};execute=async()=>{const e=this.model.getOperatingSystems();for(let t=0;t<e.length;t++){const r=e[t],s=[];s.push(this.createNoTd(t)),s.push(this.createNameTd(r)),s.push(this.createDescriptionTd(r));const a=`<tr>${s.join("")}</tr>`;$("#help-info tr:last").after(a)}(await createInstance(PageColorAdjuster)).changeBackgroundColor(),$("body").addClass("loaded")};createTd=e=>`<td class='help-info-cell'>${e}</td>`;createNoTd=e=>{const t=e+1;return this.createTd(`<p style='text-align:center;'>${t}</p>`)};createNameTd=e=>this.createTd(`<p class="work-experience-technology-operating-system" style="white-space:nowrap;">${e.name}</p>`);createDescriptionTd=e=>this.createTd(`<p>${e.description}</p>`)}export{OsHelpController};